window.bookSummaryJSON = "<p><i>“Lengard is a secret government facility for extraordinary people,” they told me.</i></p> <p><i>I believed them. That was my mistake.&nbsp;&nbsp;</i></p> <p><i>There isn’t anyone else in the world like me.&nbsp;&nbsp;</i></p> <p><i>I’m different. I’m an anomaly. I’m a monster.&nbsp;&nbsp;&nbsp;</i></p> <p>For two years, six months, fourteen days, eleven hours and sixteen minutes, Subject Six-Eight-Four - ‘Jane Doe’ - has been locked away and experimented on, without uttering a single word.&nbsp;&nbsp;</p> <p>As Jane’s resolve begins to crack under the influence of her new - and unexpectedly kind - evaluator, she uncovers the truth about Lengard’s mysterious ‘program’, discovering that her own secret is at the heart of a sinister plot...and one wrong move, one wrong word, could change the world.</p>"; 
